import { useEffect, useState } from "react"

export default function Users(){
    function DelteUser(id){

    }
    const[Data,setData]=useState([])
    useEffect(()=>{
        fetch('http://127.0.0.1:8000/api/user/show')
        .then(res=>res.json())
        .then(data=>setData(data))
    })
    const Maping=Data.map((user,index)=>
<tr>
    <td>{index}</td>
    <td>{user.name}</td>
    <td>{user.email}</td>
    <td>
        <i className="fa-solid fa-pen-to-square" style={{color:"#74afb9",paddingRight:"20px",cursor:"pointer"}}></i>
        <i onClick={DelteUser} className="fa-solid fa-trash" style={{color:"red",cursor:"pointer"}}></i>
    </td>
</tr>
    )

    return(
        <table >
            <thead>
                <th>Id</th>
                <th>Users</th>
                <th>Email</th>
                <th>Acction</th>
            
            </thead>
            <tbody>
            {Maping}
     
               
         
            </tbody>
        </table>
    )
}
